    <style id="wpr-usedcss">
        .cp-blank .cp-modal-body, .cp-modal-body.cp-blank {
            background-color: transparent
        }

        .cp-form-container.cp-no-padding {
            padding: 0 7%;
            display: block;
            width: 100%;
            margin: 0 auto;
            float: left
        }

        .cp-blank .cp-modal-window-size .cp-modal-body, .cp-modal-window-size .cp-modal-body.cp-blank {
            max-width: 90%;
            margin: 0 auto
        }

        .cp-blank .cp_responsive {
            font-family: "Open sans", serif
        }

        .cp-blank .cp-row-center {
            position: relative;
            padding: inherit
        }

        .cp-blank .cp-row-center.cp-big-content {
            position: relative
        }

        .cp-blank .cp-big-content .cp-row-equalized-center {
            position: relative;
            top: auto;
            -webkit-transform: none;
            -moz-transform: none;
            -ms-transform: none;
            -o-transform: none;
            transform: none
        }

        .cp-blank.cp-no-padding .cp-row-equalized-center {
            padding: 0 10px
        }

        .cp-blank .cp-row {
            margin: 0
        }

        .cp-blank-container .cp-overlay-close span {
            font-family: inherit
        }

        @media (min-width: 768px) {
            .cp-blank .cp-row-center {
                position: absolute;
                margin: 0;
                top: 0;
                left: 0;
                right: 0;
                height: 100%;
                padding: inherit
            }

            .cp-blank .cp-row-equalized-center {
                position: relative;
                top: 50%;
                padding: 0;
                -webkit-transform: translateY(-50%);
                -moz-transform: translateY(-50%);
                -ms-transform: translateY(-50%);
                -o-transform: translateY(-50%);
                transform: translateY(-50%)
            }
        }

        #page-preloader {
            position: fixed;
            left: 0;
            right: 0;
            top: 0;
            bottom: 0;
            z-index: 999999;
            opacity: .98;
            background: #2c2e3d
        }

        #page-preloader.preloader-loaded {
            visibility: hidden;
            opacity: 0;
            -webkit-transition: .3s ease-out;
            transition: all .3s ease-out
        }

        .no-js #page-preloader, .no-js .block-preloader {
            display: none
        }

        .preloader-spin {
            position: absolute;
            left: 50%;
            top: 50%;
            z-index: 1001;
            width: 80px;
            height: 80px;
            margin: -40px;
            border-radius: 50%;
            -moz-border-radius: 50%;
            -webkit-border-radius: 50%;
            border: 2px solid transparent;
            border-top-color: #b9b7ff;
            -webkit-animation: 2s linear infinite PreloaderSpin;
            animation: 2s linear infinite PreloaderSpin
        }

        .preloader-spin {
            border-top-color: #b9b7ff
        }

        .preloader-spin:before {
            content: "";
            position: absolute;
            top: 4px;
            left: 4px;
            right: 4px;
            bottom: 4px;
            border-radius: 50%;
            -moz-border-radius: 50%;
            -webkit-border-radius: 50%;
            border: 2px solid transparent;
            border-top-color: #00bcd4;
            -webkit-animation: 3s linear infinite PreloaderSpin;
            animation: 3s linear infinite PreloaderSpin
        }

        .preloader-spin:before {
            border-top-color: #00bcd4
        }

        .preloader-spin:after {
            content: "";
            position: absolute;
            top: 10px;
            left: 10px;
            right: 10px;
            bottom: 10px;
            border-radius: 50%;
            -moz-border-radius: 50%;
            -webkit-border-radius: 50%;
            border: 2px solid transparent;
            border-top-color: #a3e7f0;
            -webkit-animation: 1.5s linear infinite PreloaderSpin;
            animation: 1.5s linear infinite PreloaderSpin
        }

        .preloader-spin:after {
            border-top-color: #7b97ab
        }

        .fancybox-slide .gem-fancybox-preloader {
            width: 150px;
            height: 150px;
            background: 0 0;
            margin: 0;
            margin-top: -75px;
            margin-left: -75px;
            padding: 0
        }

        @-webkit-keyframes PreloaderSpin {
            0% {
                -webkit-transform: rotate(0);
                -ms-transform: rotate(0);
                transform: rotate(0)
            }
            100% {
                -webkit-transform: rotate(360deg);
                -ms-transform: rotate(360deg);
                transform: rotate(360deg)
            }
        }

        @keyframes PreloaderSpin {
            0% {
                -webkit-transform: rotate(0);
                -ms-transform: rotate(0);
                transform: rotate(0)
            }
            100% {
                -webkit-transform: rotate(360deg);
                -ms-transform: rotate(360deg);
                transform: rotate(360deg)
            }
